volcano_indonesiajava_geojson_callback({"type":"FeatureCollection","name":"lyr_volcano_indonesiajava","crs":{"type":"name","properties":{"name":"urn:ogc:def:crs:EPSG::3857"}},"features":[{"type":"Feature","properties":{"Name":"Pulosari","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Pulosari<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/114027.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1324 m<br \/><b>Latitude:<\/b> 6.34&deg;S<br \/><b>Longitude:<\/b> 105.97&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The basaltic-to-andesitic Pulosari stratovolcano at the western end of Java lies south of the 15-km-wide Pleistocene Danau caldera. The summit contains a nearly 300-m-deep crater open to the ENE with active solfataras on its wall. It is SW across a low saddle from the higher Karang volcano, which was constructed on the SE rim of Danau caldera.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263010\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11797416.99,-707546.27,0.0]}},{"type":"Feature","properties":{"Name":"Karang","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Karang<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/114026.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1768 m<br \/><b>Latitude:<\/b> 6.26&deg;S<br \/><b>Longitude:<\/b> 106.05&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Karang volcano in westernmost Java was constructed SE of the 15-km-wide Pleistocene Danau caldera.  Two craters, Kawah Welirang and Kawah Haji, display fumarolic activity and are found on the eastern flanks, which may be of Holocene age (Bronto 1995, pers. comm.). The forested andesitic and basaltic volcano is the highest of a group of stratovolcanoes in the Danau caldera area and lies across a low saddle from Pulosari volcano.     <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263020\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11805431.99,-699146.49,0.0]}},{"type":"Feature","properties":{"Name":"Perbakti-Gagak","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Perbakti-Gagak<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/045016.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1699 m<br \/><b>Latitude:<\/b> 6.75&deg;S<br \/><b>Longitude:<\/b> 106.7&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The Perbakti-Gagak volcanic complex, also known as Kiaraberes-Gagak, is a cluster of deeply eroded stratovolcanoes situated immediately SW of Salak volcano. The summit ridge of Gunung Perbakti is elongated in a NW-SE direction, and Gunung Endut volcano rises above a saddle to its SW. Gunung Gagak to the NW, is capped by pumice and obsidian, with obsidian lava flows extending N and NE.  Quaternary rhyolitic lava domes form a NNE-trending chain at the eastern side of the complex. Two 2-km-wide depressions on the northern and southern sides of Perbakti form the headwaters of the Kaluwung Herang and Pamatutan rivers, respectively. The complex is marked by vigorous geothermal activity. Fumaroles, mud pots and hot springs are located on the S and SE flanks of Perbakti and at the Kiaraberes area, which includes the commercial geothermal field of Awibengkok.  Mild phreatic eruptions took place during the Holocene into historical time from flank fumarolic fields.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263040\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11877789.66,-753150.76,0.0]}},{"type":"Feature","properties":{"Name":"Salak","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Salak<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/120031.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2211 m<br \/><b>Latitude:<\/b> 6.72&deg;S<br \/><b>Longitude:<\/b> 106.73&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Salak volcano was constructed at the NE end of an eroded volcanic range.  Satellitic cones occur on the SW flank and at the northern foot of the forested volcano.  Two large breached craters truncate the summit of Gunung Salak.  One crater is breached to the NE and the westernmost crater was the source of a debris-avalanche deposit that extends 10 km WNW of the summit.  Historical eruptions from Gunung Salak have been restricted to phreatic explosions from craters in a prominent solfataric area at 1400 m on the western flank.  Salak volcano has been the site of extensive geothermal exploration.     <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263050\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11881129.25,-749787.97,0.0]}},{"type":"Feature","properties":{"Name":"Gede-Pangrango","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Gede-Pangrango<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/120032.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3008 m<br \/><b>Latitude:<\/b> 6.77&deg;S<br \/><b>Longitude:<\/b> 106.96&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gede volcano is one of the most prominent in western Java, forming a twin volcano with Pangrango volcano to the NW. The major cities of Cianjur, Sukabumi, and Bogor are situated below the volcanic complex to the E, S, and NW, respectively. Gunung Pangrango, constructed over the NE rim of a 3 x 5 km caldera, forms the high point of the complex at just over 3000 m elevation. Many lava flows are visible on the flanks of the younger Gunung Gede, including some that may have been erupted in historical time. The steep-walled summit crater has migrated about 1 km NNW over time. Two large debris-avalanche deposits on its flanks, one of which underlies the city of Cianjur, record previous large-scale collapses. Historical activity, recorded since the 16th century, typically consists of small explosive eruptions of short duration.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263060\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11907289.33,-755392.73,0.0]}},{"type":"Feature","properties":{"Name":"Patuha","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Patuha<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/063077.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2422 m<br \/><b>Latitude:<\/b> 7.16&deg;S<br \/><b>Longitude:<\/b> 107.4&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The forested andesitic Gunung Patuha rises SW of the plain of Bandung in western Java. Two summit craters lie 600 m apart along a NW-SE line.  The NW-most and highest summit crater is dry, but the SE crater, Kawah Putih, contains a shallow greenish-white crater lake. Kawah Putih is mined for sulfur. A large debris-avalanche deposit extends to the NE. The volcano was formed during the late Pleistocene, but has a youthful morphology. No historical eruptions are known.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263070\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11955713.31,-799354.58,0.0]}},{"type":"Feature","properties":{"Name":"Tangkubanparahu","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Tangkubanparahu<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/005099.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2084 m<br \/><b>Latitude:<\/b> 6.77&deg;S<br \/><b>Longitude:<\/b> 107.6&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Tangkubanparahu (also known as Tangkuban Perahu) is a broad shield-like stratovolcano overlooking Indonesia's former capital city of Bandung.  The volcano was constructed within the 6 x 8 km Pleistocene Sunda caldera, which formed about 190,000 years ago.  The volcano's low profile is the subject of legends referring to the mountain of the \"upturnedboat.\"   The rim of Sunda caldera forms a prominent ridge on the western side; elsewhere the caldera rim is largely buried by deposits of Tangkubanparahu volcano.  The dominantly small phreatic historical eruptions recorded since the 19th century have originated from several nested craters within an elliptical 1 x 1.5 km summit depression.    <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263090\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11977977.20,-755392.73,0.0]}},{"type":"Feature","properties":{"Name":"Papandayan","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Papandayan<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010043.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2665 m<br \/><b>Latitude:<\/b> 7.32&deg;S<br \/><b>Longitude:<\/b> 107.73&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Papandayan is a complex stratovolcano with four large summit craters, the youngest of which was breached to the NE by collapse during a brief eruption in 1772 and contains active fumarole fields. The broad 1.1-km-wide, flat-floored Alun-Alun crater truncates the summit of Papandayan, and Gunung Puntang to the north gives a twin-peaked appearance. Several episodes of collapse have created an irregular profile and produced debris avalanches that have impacted lowland areas. A sulfur-encrusted fumarole field occupies historically active Kawah Mas (\"GoldenCrater\"). After its first historical eruption in 1772, in which collapse of the NE flank produced a catastrophic debris avalanche that destroyed 40 villages and killed nearly 3000 people, only small phreatic eruptions had occurred prior to an explosive eruption that began in November 2002.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263100\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11992448.74,-817084.46,0.0]}},{"type":"Feature","properties":{"Name":"Kendang","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Kendang<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/117011.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2594 m<br \/><b>Latitude:<\/b> 7.24&deg;S<br \/><b>Longitude:<\/b> 107.70&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The Quaternary Gunung Kendang volcano (also spelled Kendeng) is located immediately north of Papandayan volcano. Kendang contains four fumarole fields, the most prominent of which is Kawah Manuk, located in a broad 2.75-km-wide crater-like depression. Thermal activity consists of fumaroles with sulfur sublimation, mud pots, and hot water pools with occasional mild water ejections. The Darajat geothermal field is located on the E flank and along the Kendang fault, which extends NE to the Kawah Kamojang geothermal field. The latest eruptions produced the very young Kiamis rhyolitic lava dome and obsidian lava flows. Gunung Kiamis was labeled as Recent on a map of Whittome and Salveson (1990) and is located 2 km NE of the Darajat geothermal field.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263110\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[11990111.03,-808667.60,0.0]}},{"type":"Feature","properties":{"Name":"Tampomas","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Tampomas<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/045022.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1684 m<br \/><b>Latitude:<\/b> 6.77&deg;S<br \/><b>Longitude:<\/b> 107.95&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Tampomas, the northernmost young volcano in western Java, is a small andesitic stratovolcano overlooking the northern coastal plain about halfway between Tangkubanparahu and Cereme volcanoes.  Youthful-looking lava flows are found on its flanks.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263131\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12016939.03,-755392.73,0.0]}},{"type":"Feature","properties":{"Name":"Guntur","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Guntur<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010057.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Complex<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2249 m<br \/><b>Latitude:<\/b> 7.14&deg;S<br \/><b>Longitude:<\/b> 107.84&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Guntur is a complex of several overlapping stratovolcanoes about 10 km NW of the city of Garut in western Java. Young lava flows, the most recent of which was erupted in 1840, are visible on the flanks of the erosionally unmodified Gunung Guntur, which rises about 1550 m above the plain of Garut. It is one of a group of younger cones constructed to the SW of an older eroded group of volcanoes at the NE end of the complex. Guntur, whose name means \"thunder,\" is the only historically active center, with eruptions having been recorded since the late-17th century. Although it has produced frequent explosive eruptions in the 19th century, making it one of the most active volcanoes of western Java, it has not erupted since.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263130\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12004693.88,-797222.92,0.0]}},{"type":"Feature","properties":{"Name":"Galunggung","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Galunggung<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010061.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2168 m<br \/><b>Latitude:<\/b> 7.25&deg;S<br \/><b>Longitude:<\/b> 108.05&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The forested slopes Galunggung in western Java are cut by a large horseshoe-shaped caldera breached to the SE that has served to channel the products of recent eruptions in that direction. The \"TenThousandHillsofTasikmalaya\" dotting the plain below the volcano are debris-avalanche hummocks from the collapse that formed the breached caldera about 4200 years ago. Although historical eruptions, restricted to the central vent near the caldera headwall, have been infrequent, they have caused much devastation. The first historical eruption in 1822 produced pyroclastic flows and lahars that killed over 4000 people. More recently, a strong explosive eruption during 1982-1983 caused severe economic disruption to populated areas near the volcano.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263140\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12028961.53,-809228.68,0.0]}},{"type":"Feature","properties":{"Name":"Talagabodas","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Talagabodas<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/100068.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2201 m<br \/><b>Latitude:<\/b> 7.20&deg;S<br \/><b>Longitude:<\/b> 108.07&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The Gunung Talagabodas stratovolcano lies immediately north of the more well-known Galunggung volcano. Talagabodas, also spelled Telaga Bodas, is one of the older Quaternary volcanoes in an arcuate N-S trending volcano group east of the city of Garut and is built up of andesitic lavas and pyroclastics. Younger pyroclastics from Gunung Putri-Eweranda overlap the Talagabodas products in the north. The crater of Talagabodas has shifted 1.3 km north from the summit crater of Canar and contains a large sulfur-saturated lake.  Fumaroles, mud pots, and a warm spring are found around the lake, which has an elevated temperature. The age of the most recent eruption is not known. Changes in lake color occurred in 1913 and 1921, and expanded solfataric activity was reported in 1927. Suffocating gases have frequently killed animals that have wandered into the Pajagalan valley on the NE flank and the Kawah Saat geothermal area south of the crater lake. The Kawah Karaha fumaroles 9 km N are also part of the geothermal system (Tripp et al., 2002).<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263150\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12030297.37,-804515.80,0.0]}},{"type":"Feature","properties":{"Name":"Cereme","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Cereme<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/120020.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3078 m<br \/><b>Latitude:<\/b> 6.89&deg;S<br \/><b>Longitude:<\/b> 108.4&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The symmetrical stratovolcano Cereme, also known as Ciremai, is located closer to the northern coast than other central Java volcanoes.  A steep-sided double crater elongated in an E-W direction caps 3078-m-high Gunung Cereme, which was constructed on the northern rim of the 4.5 x 5 km Geger Halang caldera.  A large landslide deposit to the north may be associated with the origin of the caldera, although collapse may rather be due to a voluminous explosive eruption (Newhall and Dzurisin, 1988).  Eruptions, relatively infrequent in historical time, have included explosive activity and lahars, primarily from the summit crater.    <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263170\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12067032.80,-769070.81,0.0]}},{"type":"Feature","properties":{"Name":"Slamet","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Slamet<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/063023.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3428 m<br \/><b>Latitude:<\/b> 7.24&deg;S<br \/><b>Longitude:<\/b> 109.20&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Slamet, Java's second highest volcano at 3428 m and one of its most active, has a cluster of about three dozen cinder cones on its lower SE-NE flanks and a single cinder cone on the western flank. It is composed of two overlapping edifices, an older basaltic-andesite to andesitic volcano on the west and a younger basaltic to basaltic-andesite one on the east. Gunung Malang II cinder cone on the upper E flank on the younger edifice fed a lava flow that extends 6 km E. Four craters occur at the summit of Gunung Slamet, with activity migrating to the SW over time. Historical eruptions, recorded since the 18th century, have originated from a 150-m-deep, 450-m-wide, steep-walled crater at the western part of the summit and have consisted of explosive eruptions generally lasting a few days to a few weeks.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263180\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12156978.95,-808330.96,0.0]}},{"type":"Feature","properties":{"Name":"Dieng Volcanic Complex","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Dieng Volcanic Complex<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010074.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Complex<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2565 m<br \/><b>Latitude:<\/b> 7.2&deg;S<br \/><b>Longitude:<\/b> 109.87&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The Dieng plateau in the highlands of central Java is renowned both for the variety of its volcanic scenery and as a sacred area housing Java's oldest Hindu temples, dating back to the 9th century CE. The Dieng volcanic complex consists of two or more stratovolcanoes and more than 20 small craters and cones of Pleistocene-to-Holocene age over a 6 x 14 km area. Prahu stratovolcano was truncated by a large Pleistocene caldera, which was subsequently filled by a series of dissected to youthful cones, lava domes, and craters, many containing lakes.  Lava flows cover much of the plateau, but have not occurred in historical time, when activity has been restricted to minor phreatic eruptions. Toxic gas emissions are a hazard at several craters and have caused fatalities. The abundant thermal features and high heat flow make Dieng a major geothermal prospect.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263200\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12231674.32,-803618.16,0.0]}},{"type":"Feature","properties":{"Name":"Sundoro","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Sundoro<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010077.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3136 m<br \/><b>Latitude:<\/b> 7.3&deg;S<br \/><b>Longitude:<\/b> 109.99&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Sundoro, one Java's most symmetrical volcanoes, is separated by a 1400-m-high saddle from Sumbing volcano.  Parasitic craters and cones, the largest of which is Kembang, occur on the NW-to-southern flanks, and all fed lava flows.  A small lava dome occupies the summit crater, and numerous phreatic explosion vents were formed along radial fissure that cut the dome and extend across the crater rim. Lava flows extend in all directions from the summit crater.  Deposits of a large prehistoric debris avalanche are located below the NE flank. Pyroclastic-flow deposits dated at 1720 years before present extend as far as 13 km from the summit.  Historical eruptions typically have consisted of mild-to-moderate phreatic explosions, mostly from the summit crater.  Flank vents were also active in 1882 and 1903.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263210\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12244253.43,-814839.83,0.0]}},{"type":"Feature","properties":{"Name":"Sumbing","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Sumbing<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/010082.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3371 m<br \/><b>Latitude:<\/b> 7.38&deg;S<br \/><b>Longitude:<\/b> 110.07&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Sumbing is a prominent 3371-m-high stratovolcano that lies across a 1400-m-high saddle from symmetrical Sundoro volcano in central Java. Prominent cones are located on the N and SE flanks, which is somewhat more dissected than Sundoro. An 800-m-wide horseshoe-shaped summit crater breached to the NE is partially filled by a lava dome that fed a lava flow down to 2400 m elevation. Emplacement of the dome followed the eruption of extensive pyroclastic flows down the NE flank. The only report of historical activity, in about 1730 CE, may have produced the small phreatic craters found at the summit.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263220\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12252936.35,-824267.97,0.0]}},{"type":"Feature","properties":{"Name":"Telomoyo","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Telomoyo<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/086086.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1864 m<br \/><b>Latitude:<\/b> 7.36&deg;S<br \/><b>Longitude:<\/b> 110.4&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Telomoyo volcano, also spelled Telemojo, was constructed over the southern flank of the eroded Pleistocene Soropati volcano and is in part Holocene (van Bemmelen 1941). It lies along a NNW-SSE-trending line of volcanoes extending from Ungaran in the north to Merapi in the south. The eastern flank of Soropati collapsed during the Pleistocene, leaving a U-shaped depression.  Telomoyo subsequently filled much of the southern side of this depression and grew to a height of 600 m above its rim.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263231\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12289671.78,-821798.52,0.0]}},{"type":"Feature","properties":{"Name":"Ungaran","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Ungaran<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/045028.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2050 m<br \/><b>Latitude:<\/b> 7.18&deg;S<br \/><b>Longitude:<\/b> 110.33&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Ungaran volcano, S of the northern coastal city of Semarang, lies at the northern end of a transverse chain of Java volcanoes extending NNW from Merapi. It was formed in three stages, with growth of the youngest edifice taking place during the late Pleistocene and Holocene. This youngest edifice was constructed S of three large remnant structural blocks of the second Ungaran volcano. A group of pyroclastic cones was also constructed along the margins of the older edifice. The volcano is deeply eroded and no historical eruptions have been reported, but two active fumarole fields are located on its flanks.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263230\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12281879.41,-801374.12,0.0]}},{"type":"Feature","properties":{"Name":"Merbabu","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Merbabu<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011012.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3118 m<br \/><b>Latitude:<\/b> 7.45&deg;S<br \/><b>Longitude:<\/b> 110.44&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Merbabu is a massive forested volcano located to the north of the renowned Merapi volcano in central Java. Three prominent radial valleys extend from the summit toward the NW, NNE, and ESE. The most recent magmatic eruptions originated from a NNW-SSE fissure system that cut across the summit and fed the large-volume Kopeng and Kajor lava flows on the northern and southern flanks, respectively. Moderate explosive eruptions have occurred from the summit crater in historical time.     <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263240\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12294124.56,-832126.12,0.0]}},{"type":"Feature","properties":{"Name":"Muria","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Muria<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/115010.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1625 m<br \/><b>Latitude:<\/b> 6.62&deg;S<br \/><b>Longitude:<\/b> 110.88&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Muria (also spelled Muriah) stratovolcano forms the broad Muria Peninsula along the northern coast of central Java and lies well N of the main volcanic chain. This  volcano occupies much of the peninsula and is flanked by Genuk volcano, an eroded lava-dome complex near the coast at the Muria's northern base. It is largely Pleistocene in age and displays deeply eroded flanks.  The summit of the high-potassium volcano is cut by several large N-S-trending craters, some containing lava domes.  Numerous flank vents include lava domes, cinder cones, and maars.  The most recent eruptive activity produced three maars on the SE and NE flanks and a lava flow from a SE-flank vent that entered one of the maars.  Conflicting late-Pleistocene to Holocene age dates for these maars leave uncertainties about their ages, but their youthful morphology in surrounding eroded terrain suggests a probable Holocene age, and they could be as young as several thousand years.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263251\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12343105.13,-738580.16,0.0]}},{"type":"Feature","properties":{"Name":"Merapi","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Merapi<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/017022.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2910 m<br \/><b>Latitude:<\/b> 7.54&deg;S<br \/><b>Longitude:<\/b> 110.44&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Merapi, one of Indonesia's most active volcanoes, lies in one of the world's most densely populated areas and dominates the landscape immediately north of the major city of Yogyakarta. It is the youngest and southernmost of a volcanic chain extending NNW to Ungaran volcano. Growth of Old Merapi during the Pleistocene ended with major edifice collapse perhaps about 2000 years ago, leaving a large arcuate scarp cutting the eroded older Batulawang volcano. Subsequently growth of the steep-sided Young Merapi edifice, its upper part unvegetated due to frequent eruptive activity, began SW of the earlier collapse scarp. Pyroclastic flows and lahars accompanying growth and collapse of the steep-sided active summit lava dome have devastated cultivated lands on the western-to-southern flanks and caused many fatalities during historical time.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263250\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12294792.48,-841782.14,0.0]}},{"type":"Feature","properties":{"Name":"Lawu","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Lawu<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011014.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3265 m<br \/><b>Latitude:<\/b> 7.62&deg;S<br \/><b>Longitude:<\/b> 111.19&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The massive compound stratovolcano Lawu contains an older, deeply eroded volcano on the north separated by a crescentic rift valley from the younger Lawu volcano of Holocene age (van Bemmelen, 1949b).  Parasitic crater lakes and pyroclastic cones are found at the eastern side of the rift.  The younger Lawu volcano contains eroded crater rims; its latest activity, including construction of a lava dome, occurred at the south end.  A fumarolic area is located on the south flank at 2550 m.  The only reported historical eruption from Lawu took place in 1885, when rumblings and light ashfall were reported.  A major eruption reported from Lawu in 1752 was from neighboring Kelut volcano.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263260\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12377836.82,-851327.76,0.0]}},{"type":"Feature","properties":{"Name":"Wilis","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Wilis<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/093056.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2563 m<br \/><b>Latitude:<\/b> 7.80&deg;S<br \/><b>Longitude:<\/b> 111.75&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Wilis is a solitary volcanic massif surrounded by low-elevation plains on all but its southern side. It was formed during three episodes dating back to the mid Pleistocene. Following destruction of the 2nd edifice, the most recent cone grew during the Holocene. No confirmed historical eruptions are known, although there was a report of an eruption in 1641 CE, the same year as a major eruption of nearby Kelut. Fumaroles and mud pots occur near Lake Ngebel on the lower western flank.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263270\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12440843.65,-871885.40,0.0]}},{"type":"Feature","properties":{"Name":"Kawi-Butak","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Kawi-Butak<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/092065.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2651 m<br \/><b>Latitude:<\/b> 7.92&deg;S<br \/><b>Longitude:<\/b> 112.45&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The broad Kawi-Butak volcanic massif lies immediately E of Kelut volcano and S of Arjuno-Welirang volcano.  Gunung Kawi was constructed to the NW of Gunung Butak.  No historical eruptions are known from either volcano, but both are primarily of Holocene age.  <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263281\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12517876.73,-884471.55,0.0]}},{"type":"Feature","properties":{"Name":"Kelut","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Kelut<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/017033.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1731 m<br \/><b>Latitude:<\/b> 7.93&deg;S<br \/><b>Longitude:<\/b> 112.30&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The relatively inconspicuous, 1731-m-high Kelut stratovolcano contains a summit crater lake that has been the source of some of Indonesia's most deadly eruptions. A cluster of summit lava domes cut by numerous craters has given the summit a very irregular profile. Satellitic cones and lava domes are also located low on the eastern, western, and SSW flanks. Eruptive activity has in general migrated in a clockwise direction around the summit vent complex. More than 30 eruptions have been recorded from Gunung Kelut since 1000 CE. The ejection of water from the crater lake during the typically short but violent eruptions has created pyroclastic flows and lahars that have caused widespread fatalities and destruction. After more than 5000 people were killed during an eruption in 1919, an ambitious engineering project sought to drain the crater lake. This initial effort lowered the lake by more than 50 m, but the 1951 eruption deepened the crater by 70 m, leaving 50 million cubic meters of water after repair of the damaged drainage tunnels. After more than 200 deaths in the 1966 eruption, a new deeper tunnel was constructed, and the lake's volume before the 1990 eruption was only about 1 million cubic meters.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263280\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12502069.37,-885595.48,0.0]}},{"type":"Feature","properties":{"Name":"Penanggungan","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Penanggungan<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/064080.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1631 m<br \/><b>Latitude:<\/b> 7.61&deg;S<br \/><b>Longitude:<\/b> 112.62&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Gunung Penanggungan, one of Java's most revered mountains, is a small stratovolcano constructed immediately north of the Arjuno-Welirang massif. Numerous ruins of sanctuaries, monuments, and sacred bathing places dating from 977-1511 CE are found on the northern and western flanks. Lava flows from flank vents descend all sides of the 1653-m-high volcano and pyroclastic-flow deposits form an apron around it. Penanggungan was mapped as similar in age to Arjuno-Welirang and Semeru volcanoes by van Bemmelen (1937). Penanggungan was considered to be extinct for at least 1000 years. Its last eruption may have occurred about 200 CE.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263291\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12536801.05,-850316.96,0.0]}},{"type":"Feature","properties":{"Name":"Malang Plain","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Malang Plain<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/117009.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Maar(s)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 680 m<br \/><b>Latitude:<\/b> 8.02&deg;S<br \/><b>Longitude:<\/b> 112.68&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">A group of nine ash cones, maars, and volcanic plugs of subrecent-to-recent (Holocene) age are found on the Malang Plain, SE and NE of the city of Malang (van Bemmelen, 1937). Some of these may be partly parasitic to Tengger Caldera, although others have no clear connection to any specific eruption center and are situated on a distinct N-S zone of tectonic weakness.     <\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263292\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12543480.22,-895712.07,0.0]}},{"type":"Feature","properties":{"Name":"Arjuno-Welirang","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Arjuno-Welirang<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/045031.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3339 m<br \/><b>Latitude:<\/b> 7.73&deg;S<br \/><b>Longitude:<\/b> 112.57&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The twin volcanoes of Arjuno and Welirang anchor the SE and NW ends, respectively, of a 6-km-long line of volcanic cones and craters. The Arjuno-Welirang complex overlies two older volcanoes, Gunung Ringgit to the east and Gunung Linting to the south. The summit areas of both volcanoes are unvegetated. Additional pyroclastic cones are located on the north flank of Gunung Welirang and along an E-W line cutting across the southern side of Gunung Arjuno that extends to the lower SE flank. Fumarolic areas with sulfur deposition occur at several locations on Gunung Welirang.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263290\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12531791.67,-863459.06,0.0]}},{"type":"Feature","properties":{"Name":"Semeru","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Semeru<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/007036.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3657 m<br \/><b>Latitude:<\/b> 8.10&deg;S<br \/><b>Longitude:<\/b> 112.92&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Semeru, the highest volcano on Java, and one of its most active, lies at the southern end of a volcanic massif extending north to the Tengger caldera. The steep-sided volcano, also referred to as Mahameru (Great Mountain), rises above coastal plains to the south.  Gunung Semeru was constructed south of the overlapping Ajek-ajek and Jambangan calderas. A line of lake-filled maars was constructed along a N-S trend cutting through the summit, and cinder cones and lava domes occupy the eastern and NE flanks. Summit topography is complicated by the shifting of craters from NW to SE. Frequent 19th and 20th century eruptions were dominated by small-to-moderate explosions from the summit crater, with occasional lava flows and larger explosive eruptions accompanied by pyroclastic flows that have reached the lower flanks of the volcano.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263300\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12570419.53,-905606.02,0.0]}},{"type":"Feature","properties":{"Name":"Tengger Caldera","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Tengger Caldera<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011027.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2329 m<br \/><b>Latitude:<\/b> 7.94&deg;S<br \/><b>Longitude:<\/b> 112.95&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The 16-km-wide Tengger caldera is located at the northern end of a volcanic massif extending from Semeru volcano. The massive volcanic complex dates back to about 820,000 years ago and consists of five overlapping stratovolcanoes, each truncated by a caldera. Lava domes, pyroclastic cones, and a maar occupy the flanks of the massif. The Ngadisari caldera at the NE end of the complex formed about 150,000 years ago and is now drained through the Sapikerep valley. The most recent of the calderas is the 9 x 10 km wide Sandsea caldera at the SW end of the complex, which formed incrementally during the late Pleistocene and early Holocene. An overlapping cluster of post-caldera cones was constructed on the floor of the Sandsea caldera within the past several thousand years. The youngest of these is Bromo, one of Java's most active and most frequently visited volcanoes.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263310\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12573536.48,-886944.23,0.0]}},{"type":"Feature","properties":{"Name":"Lamongan","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Lamongan<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/007048.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1651 m<br \/><b>Latitude:<\/b> 7.97&deg;S<br \/><b>Longitude:<\/b> 113.34&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Lamongan, a small stratovolcano located between the massive Tengger and Iyang-Argapura volcanic complexes, is surrounded by numerous maars and cinder cones. The currently active cone has been constructed 650 m SW of Gunung Tarub, the volcano's high point. As many as 27 maars with diameters from 150 to 700 m, some containing crater lakes, surround the volcano, along with about 60 cinder cones and spatter cones. Lake-filled maars, including Ranu Pakis, Ranu Klakah, and Ranu Bedali, are located on the E and W flanks; dry maars are predominately located on the N flanks. None of the maars has erupted during historical time, although several of the youthful maars cut drainage channels from Gunung Tarub. The volcano was very active from the time of its first historical eruption in 1799 through the end of the 19th century, producing frequent explosive eruptions and lava flows from vents on the western side ranging from the summit to about 450 m elevation.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263320\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12617173.72,-891103.12,0.0]}},{"type":"Feature","properties":{"Name":"Iyang-Argapura","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Iyang-Argapura<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011038.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Complex<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3088 m<br \/><b>Latitude:<\/b> 7.97&deg;S<br \/><b>Longitude:<\/b> 113.57&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The massive Iyang-Argapura volcanic complex dominates the landscape between Raung and Lamongan volcanoes in eastern Java. Valleys up to 1000 m deep dissect the strongly eroded basal Iyang volcano. Several Holocene volcanic cones have been constructed at the center of a N-S-trending central rift. No major eruptions have occurred within at least the last 500 years, although there was an unverified report of an eruption in 1597 CE. Fumaroles occur in some of the many explosion pits found in the summit crater complex.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263330\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12642554.56,-890091.47,0.0]}},{"type":"Feature","properties":{"Name":"Raung","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Raung<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011043.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 3260 m<br \/><b>Latitude:<\/b> 8.11&deg;S<br \/><b>Longitude:<\/b> 114.05&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">Raung, one of Java's most active volcanoes, is a massive stratovolcano in easternmost Java that was constructed SW of the rim of Ijen caldera. The unvegetated summit is truncated by a dramatic steep-walled, 2-km-wide caldera that has been the site of frequent historical eruptions. A prehistoric collapse of Gunung Gadung on the W flank produced a large debris avalanche that traveled 79 km, reaching nearly to the Indian Ocean. Raung contains several centers constructed along a NE-SW line, with Gunung Suket and Gunung Gadung stratovolcanoes being located to the NE and W, respectively.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263340\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12696655.84,-906842.91,0.0]}},{"type":"Feature","properties":{"Name":"Baluran","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Baluran<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/011068.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 1247 m<br \/><b>Latitude:<\/b> 7.85&deg;S<br \/><b>Longitude:<\/b> 114.37&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The small 1247-m-high andesitic volcano of Baluran, dwarfed by its neighbor Ijen volcano to the SW, occupies the very NE tip of Java.  Gunung Baluran contains a broad horseshoe-shaped crater breached to the NE.  The volcano lies within a national park and game reserve featuring savannah grasslands and monsoon forests.  Baluran was considered by van Bemmelen (1949b) to be of Holocene age.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263351\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12731610.16,-876604.80,0.0]}},{"type":"Feature","properties":{"Name":"Ijen","description":"<table border=\"0\" cellspacing=\"3\" width=\"320\" align=\"center\">\n<tr align=\"left\"><td colspan=\"2\"><a href=\"http:\/\/volcano.si.edu\/\"><img src=\"http:\/\/volcano.si.edu\/includes\/images\/gvp_logo.png\" width=\"400\" height=\"80\" \/><\/a><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><hr \/><font size=\"6\"><b>Ijen<\/b><\/font><br \/><font size=\"5\"><b>Java<\/b><\/font><\/td><\/tr>\n<tr align=\"center\"><td colspan=\"2\"><img src = \"http:\/\/volcano.si.edu\/Photos\/small\/007081.jpg\"><\/td><\/tr>\n<tr align=\"left\" valign=\"top\">\n<td width=\"50%\" align=\"left\"><b>Volcano type:<\/b><br \/>&nbsp;&nbsp;&nbsp; Stratovolcano(es)<\/td>\n<td width=\"50%\" align=\"left\"><b>Summit Elev:<\/b> 2769 m<br \/><b>Latitude:<\/b> 8.05&deg;S<br \/><b>Longitude:<\/b> 114.24&deg;E<\/td>\n<\/tr>\n<tr><td colspan=\"2\"><p align=\"justify\">The Ijen volcano complex at the eastern end of Java consists of a group of small stratovolcanoes constructed within the large 20-km-wide Ijen (Kendeng) caldera. The north caldera wall forms a prominent arcuate ridge, but elsewhere the caldera rim is buried by post-caldera volcanoes, including Gunung Merapi, which forms the high point of the complex. Immediately west of the Gunung Merapi stratovolcano is the historically active Kawah Ijen crater, which contains a nearly 1-km-wide, turquoise-colored, acid lake. Picturesque Kawah Ijen is the world's largest highly acidic lake and is the site of a labor-intensive sulfur mining operation in which sulfur-laden baskets are hand-carried from the crater floor. Many other post-caldera cones and craters are located within the caldera or along its rim. The largest concentration of cones forms an E-W zone across the southern side of the caldera. Coffee plantations cover much of the caldera floor, and tourists are drawn to its waterfalls, hot springs, and volcanic scenery.<\/p><\/td><\/tr>\n<tr height=\"6\"><td colspan=\"2\"><hr \/><\/td><\/tr>\n<\/table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"320\" align=\"center\">\n<tr align=\"center\">\n<td width=\"33%\"><a href=\"http:\/\/volcano.si.edu\/volcano.cfm?vn=263350\">Smithsonian Volcano Information<\/a><\/td>\n\n\n<\/tr><\/table>","timestamp":null,"begin":null,"end":null,"altitudeMode":null,"tessellate":-1,"extrude":0,"visibility":-1,"drawOrder":null,"icon":null},"geometry":{"type":"Point","coordinates":[12717361.26,-899984.19,0.0]}}]});